INSERT INTO `auto_question_bank` VALUES (NULL, NULL, NULL, NULL, 0, '2024-08-20 15:11:18', '2024-08-20 15:11:18', '297c3f58-2b98-44f9-9be3-254cab311c7b', 172603651568343, '58e9717d-f7c9-408b-ab3e-d5950ece70ca', '1bac00e0-6437-4765-8181-6fe777aaa554', '68d6b53e-379d-4a12-8834-da65bbbdb60f', '通用', '通用', '84e19827-dccf-46ed-9497-f3a6e72eca84', 1, '<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">&nbsp;（多选）</span><span style=\"font-size: 12pt;\"><font face=\"宋体\">导航地图可以显示一个航迹向量</font>(航迹趋势线)，这对减小航迹角度误差很有用，轨迹向量是延伸到预计位置的实心青色线段。轨迹向量的预估时间决定了轨迹向量的长度，航迹向量的预估时间是可以选择的，在下列可选时间中，选择设置一时间时，趋势向量可以最大显示90度转弯？&nbsp; &nbsp;</span><span style=\"font-size: 12pt;\">&nbsp;&nbsp;</span><img src=\"/Dir_ResData/637364897060314404.png\" class=\"img1\" style=\"font-size: 12pt;\"><span style=\"font-size: 12pt;\">&nbsp; &nbsp; &nbsp; &nbsp;</span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">A</span><span style=\"font-size: 12pt;\">.</span><span style=\"font-size: 12pt;\">30秒 </span><span style=\"font-size: 12pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">B</span><span style=\"font-size: 12pt;\">.</span><span style=\"font-size: 12pt;\">60秒 </span><span style=\"font-size: 12pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">C</span><span style=\"font-size: 12pt;\">.</span><span style=\"font-size: 12pt;\">2分钟</span><span style=\"font-size: 12pt;\">&nbsp;</span><span style=\"font-size: 12pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">D</span><span style=\"font-size: 12pt;\">.</span><span style=\"font-size: 12pt;\">5分钟</span></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><br></p>', 'A B\n解析：航迹向量的预估时间是可以选择的，(30秒、60秒(默认)、2分钟、5分钟、10分钟、20分钟)，并决定了轨迹向量的长度，在30秒和60秒的时间设置中，轨迹向量最多显示90度转弯。在2分钟、5分钟、10分钟、20分钟时间设置中，它总是显示一条直线。', 'A B\n解析：航迹向量的预估时间是可以选择的，(30秒、60秒(默认)、2分钟、5分钟、10分钟、20分钟)，并决定了轨迹向量的长度，在30秒和60秒的时间设置中，轨迹向量最多显示90度转弯。在2分钟、5分钟、10分钟、20分钟时间设置中，它总是显示一条直线。', 0, 0, NULL, NULL);
