INSERT INTO `auto_question_bank` VALUES (NULL, NULL, NULL, NULL, 0, '2024-08-20 15:11:14', '2024-08-20 15:11:14', '3253f5ad-3cdb-4bf2-add1-c8aae9953f2a', 172603657299794, '58e9717d-f7c9-408b-ab3e-d5950ece70ca', '1bac00e0-6437-4765-8181-6fe777aaa554', '68d6b53e-379d-4a12-8834-da65bbbdb60f', '通用', '通用', 'be375a95-7dd5-4e77-a85b-9ce076afaab7', 1, '关于特殊机场运行说法正确的是\nA.合格证持有人应当保证，在飞往或者飞离特殊机场的运行中担任机长的驾驶员，应当在前24个日历月之内曾作为飞行机组成员飞过该机场（包括起飞和着陆），或者曾使用经局方认可的该机场图形演示设备或者飞行模拟机进行训练并获得资格。 \nB.如果机场的云底高度，至少高于最低航路高度（MEA），最低超障高度（MOCA）或者该机场仪表进近程序规定的起始进近高度最低者之上300米，而且该机场的能见度至少为4800米，则进入该机场（包括起飞或者着陆）时，可以不对机长作特殊机场资格要求。 \nC.在需要特殊类型导航资格的航路或者区域上两个航站之间担任机长的驾驶员，应当在前6个月日历月之内，以局方认可的方式，证明其合格于使用该导航系统。', 'B', 'B', 0, 0, NULL, NULL);
